const Productimages = (props) => {
    return (
        <>
            {
                prodID ?
                    product.imageuploaded && product.imageuploaded === 'true' ?
                        "" :
                        product.productPictureviewonly && product.productPictureviewonly.length > 0 ?
                            product.productPictureviewonly.map(option =>
                                <img key={option._id} alt="" src={process.env.React_App_PUBLIC_URL_PRODUCTS + `${option.img}`} style={{ width: '110px', margin: '5px' }} />
                            )
                            : ""
                    : ""
            }
        </>
    )
}
